div.div:
#include <iostream>
int main(int argc, char** argv) {
std::cout << "Hello, World!" << std::endl;
return 0;
}
Переменные argc и argv (названия могут быть другими, но принято называть именно так) содержат в себе количество переданных аргументов командной строки и сами аргументы соответственно. Начальное количество аргументов всегда равно 1, т.к. неявно первым аргументом является название программы.
